import './App.css';
import nutritionInfo from "./NutritionInfo";

function App() {
  const [nutritionInfo, setNutritionInfo] = useState(false);




  const handleNutritionInfoClick = () => {
    setNutritionInfo(true);
  };


  if (setNutritionInfo) {
    return <NutritionInfo />;
  }


  return (
    <><h1>This is the main page</h1><button className="set-goal-button" onClick={handleNutritionInfoClick}>
      Set Goal
    </button></>



  );
}

export default App;
